/*Table structure for table `order` */

DROP TABLE IF EXISTS `order`;

CREATE TABLE `order` (
  `id` bigint(20) unsigned NOT NULL COMMENT '订单编号',
  `item_id` bigint(20) unsigned NOT NULL COMMENT '商品id',
  `seller_id` bigint(20) unsigned NOT NULL COMMENT '卖家id',
  `number` tinyint(3) unsigned NOT NULL COMMENT '购买个数',
  `per_price` decimal(10,2) unsigned DEFAULT NULL COMMENT '单价',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '交易是否完成(1为完成)',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除(1为删除)',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `seller_id` (`seller_id`),
  KEY `item_id` (`item_id`),
  CONSTRAINT `order_ibfk_1` FOREIGN KEY (`seller_id`) REFERENCES `user_details` (`id`),
  CONSTRAINT `order_ibfk_2` FOREIGN KEY (`item_id`) REFERENCES `item` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

