/*Table structure for table `user_details` */

DROP TABLE IF EXISTS `user_details`;

CREATE TABLE `user_details` (
  `id` bigint(20) unsigned NOT NULL COMMENT '主键',
  `username` varchar(50) NOT NULL COMMENT '用户名',
  `realname` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `nickname` varchar(50) DEFAULT '用户' COMMENT '昵称',
  `head` varchar(200) DEFAULT 'https://market-information.oss-cn-heyuan.aliyuncs.com/user_head/default.png' COMMENT '用户头像(准备使用阿里云对象存储)',
  `gender` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别(0不详，1男，2女)',
  `age` tinyint(3) unsigned DEFAULT NULL COMMENT '用户年龄',
  `tel` varchar(13) DEFAULT NULL COMMENT '用户电话',
  `email` varchar(80) NOT NULL COMMENT '电子邮箱',
  `qq` int(15) DEFAULT NULL COMMENT '用户qq',
  `address` varchar(200) DEFAULT NULL COMMENT '收货地址',
  `introduction` varchar(500) NOT NULL DEFAULT '暂无简介' COMMENT '个人简介',
  `is_deleted` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '逻辑删除',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

