/*Table structure for table `user_order` */

DROP TABLE IF EXISTS `user_order`;

CREATE TABLE `user_order` (
  `id` bigint(20) unsigned NOT NULL COMMENT '订单编号',
  `buyer_id` bigint(20) unsigned NOT NULL COMMENT '买家id',
  `item_id` bigint(20) unsigned NOT NULL COMMENT '商品编号',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除(1为删除)',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `buyer_id` (`buyer_id`),
  KEY `item_id` (`item_id`),
  CONSTRAINT `user_order_ibfk_1` FOREIGN KEY (`buyer_id`) REFERENCES `user_details` (`id`),
  CONSTRAINT `user_order_ibfk_2` FOREIGN KEY (`item_id`) REFERENCES `item` (`id`),
  CONSTRAINT `user_order_ibfk_3` FOREIGN KEY (`id`) REFERENCES `order` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

